import React from "react";
import ExpenseItem from "./ExpenseItem";

const Expenses = (props) => {

    return(
    <React.Fragment>
    {props.expenses.map(item => <ExpenseItem title={item.title} amount={item.amount} date={item.date} />)}
    </React.Fragment>
    );
}

export default Expenses;
